import React from "react";
import Tabletop from "tabletop";

function PublicShame(props) {
  const [shame, setShame] = [];

  function fetchData() {
    Tabletop.init({
      key: "1l8JYfCSKMGYGjZ45XhGSmtwS9p8h82sZY9UAP1PaTL4",
      callback: (googleData) => {
        setData(googleData);
        setLoading(false);
      },
      simpleSheet: true,
    });
  }
  return (
    <div>
      <div>This is public shaming list</div>
    </div>
  );
}

export default PublicShame;
